"use client"

import { useState, useEffect } from "react"
import { useNavigate } from "react-router-dom"
import { Button } from "./ui/button"
import { Input } from "./ui/input"
import { Label } from "./ui/label"
import { Heart, Activity, Stethoscope, Plus } from "lucide-react"

export default function SignInForm() {
  const navigate = useNavigate()
  const [formData, setFormData] = useState({
    fullName: "",
    dateOfBirth: "",
    phoneNumber: "",
  })
  const [isLoading, setIsLoading] = useState(false)

  useEffect(() => {
    const savedData = localStorage.getItem("signInFormData")
    if (savedData) {
      const parsedData = JSON.parse(savedData)
      setFormData({
        fullName: parsedData.fullName || "",
        dateOfBirth: parsedData.dateOfBirth || "",
        phoneNumber: parsedData.phoneNumber || "",
      })
    }
  }, [])

  const handleInputChange = (field, value) => {
    if (field === "phoneNumber") {
      const digitsOnly = value.replace(/\D/g, "")
      setFormData((prev) => ({
        ...prev,
        [field]: digitsOnly,
      }))
    } else {
      setFormData((prev) => ({
        ...prev,
        [field]: value,
      }))
    }
  }

  const handleNext = async () => {
    if (!formData.fullName.trim()) {
      alert("Please enter your Full Name")
      return
    }

    if (!formData.dateOfBirth) {
      alert("Please select your Date of Birth")
      return
    }

    if (!formData.phoneNumber.trim()) {
      alert("Please enter your Phone Number")
      return
    }

    if (!/^\d{10}$/.test(formData.phoneNumber)) {
      alert("Phone Number must be exactly 10 digits")
      return
    }

    setIsLoading(true)

    // Simulate loading
    await new Promise((resolve) => setTimeout(resolve, 1500))

    localStorage.setItem("signInFormData", JSON.stringify(formData))
    navigate("/address")
  }

  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-50 via-blue-50 to-teal-50 relative overflow-hidden font-be-vietnam">
      {/* Animated Background Elements */}
      <div className="absolute inset-0 overflow-hidden">
        {/* Floating Medical Icons */}
        <div className="absolute top-20 left-10 animate-float">
          <Heart className="w-6 h-6 text-red-300 opacity-30" />
        </div>
        <div className="absolute top-40 right-16 animate-float-delayed">
          <Stethoscope className="w-8 h-8 text-teal-300 opacity-25" />
        </div>
        <div className="absolute bottom-32 left-20 animate-float">
          <Plus className="w-5 h-5 text-blue-300 opacity-30" />
        </div>
        <div className="absolute bottom-20 right-10 animate-float-delayed">
          <Activity className="w-7 h-7 text-green-300 opacity-25" />
        </div>

        {/* Animated Circles */}
        <div className="absolute top-1/4 left-1/4 w-32 h-32 bg-gradient-to-r from-teal-200 to-blue-200 rounded-full opacity-20 animate-pulse-slow"></div>
        <div className="absolute bottom-1/4 right-1/4 w-24 h-24 bg-gradient-to-r from-blue-200 to-green-200 rounded-full opacity-15 animate-pulse-slower"></div>
      </div>

      {/* Enhanced Header */}
      <div className="relative w-full h-32 bg-gradient-to-br from-teal-600 via-teal-700 to-emerald-700 overflow-hidden shadow-lg">
        {/* Medical Cross Pattern */}
        <div className="absolute inset-0 opacity-10">
          <svg width="100%" height="100%" viewBox="0 0 60 60" className="w-full h-full">
            <defs>
              <pattern id="medicalPattern" x="0" y="0" width="30" height="30" patternUnits="userSpaceOnUse">
                <path d="M15,5 L15,25 M5,15 L25,15" stroke="white" strokeWidth="2" strokeLinecap="round" />
              </pattern>
            </defs>
            <rect width="100%" height="100%" fill="url(#medicalPattern)" />
          </svg>
        </div>

        {/* Animated Heartbeat Line */}
        <div className="absolute top-1/2 left-0 w-full transform -translate-y-1/2 opacity-60">
          <svg width="100%" height="60" viewBox="0 0 1000 60" preserveAspectRatio="none">
            <path
              d="M0,30 L100,30 L120,15 L140,45 L160,10 L180,50 L200,25 L220,30 L300,30 L320,20 L340,40 L360,15 L380,45 L400,30 L500,30 L520,18 L540,42 L560,12 L580,48 L600,28 L620,30 L700,30 L720,22 L740,38 L760,14 L780,46 L800,30 L1000,30"
              fill="none"
              stroke="white"
              strokeWidth="2"
              strokeLinecap="round"
              strokeLinejoin="round"
              className="animate-heartbeat"
            />
          </svg>
        </div>

        {/* Floating Medical Icons */}
        <div className="absolute inset-0 flex items-center justify-between px-12">
          <div className="opacity-40 animate-pulse">
            <Heart className="w-8 h-8 text-white animate-heartbeat-icon" />
          </div>
          <div className="opacity-50 animate-bounce-slow">
            <Activity className="w-10 h-10 text-white" />
          </div>
        </div>

        {/* Animated DNA Helix */}
        <div className="absolute right-8 top-0 h-full opacity-30">
          <svg width="40" height="128" viewBox="0 0 40 128" className="animate-spin-slow">
            <path
              d="M10,0 Q25,16 30,32 Q25,48 10,64 Q25,80 30,96 Q25,112 10,128"
              fill="none"
              stroke="white"
              strokeWidth="1.5"
              strokeDasharray="3,3"
            />
            <path
              d="M30,0 Q15,16 10,32 Q15,48 30,64 Q15,80 10,96 Q15,112 30,128"
              fill="none"
              stroke="white"
              strokeWidth="1.5"
              strokeDasharray="3,3"
            />
          </svg>
        </div>

        {/* Medical Cross */}
        <div className="absolute left-8 top-1/2 transform -translate-y-1/2 opacity-40">
          <div className="relative">
            <Plus className="w-8 h-8 text-white animate-pulse" />
            <div className="absolute inset-0 animate-ping">
              <Plus className="w-8 h-8 text-white opacity-30" />
            </div>
          </div>
        </div>

        {/* Gradient Overlay */}
        <div className="absolute inset-0 bg-gradient-to-t from-black/10 to-transparent"></div>
      </div>

      <div className="relative z-10 px-6 py-8 space-y-8">
        <div className="text-center space-y-4">
          <h1 className="text-4xl font-bold text-transparent bg-clip-text bg-gradient-to-r from-teal-600 to-blue-600 animate-fade-in font-be-vietnam">
            Sign IN
          </h1>
          <p className="text-lg text-gray-600 animate-fade-in-delayed font-be-vietnam">
            Hi welcome, you've been missed
          </p>
        </div>

        <div className="space-y-8">
          <div className="space-y-3 animate-slide-up">
            <Label className="text-xl font-semibold text-gray-800 flex items-center gap-2 font-be-vietnam">
              <div className="w-2 h-2 bg-teal-500 rounded-full animate-pulse"></div>
              Full Name :
            </Label>
            <div className="relative group">
              <Input
                type="text"
                placeholder="Full name"
                value={formData.fullName}
                onChange={(e) => handleInputChange("fullName", e.target.value)}
                className="h-14 bg-white/80 backdrop-blur-sm border-2 border-gray-200 rounded-xl text-gray-700 placeholder:text-gray-500 text-lg px-4 transition-all duration-300 focus:border-teal-400 focus:shadow-lg focus:shadow-teal-100 hover:border-teal-300 font-be-vietnam"
                required
              />
              <div className="absolute inset-0 rounded-xl bg-gradient-to-r from-teal-400/10 to-blue-400/10 opacity-0 group-hover:opacity-100 transition-opacity duration-300 pointer-events-none"></div>
            </div>
          </div>

          <div className="space-y-3 animate-slide-up-delayed">
            <Label className="text-xl font-semibold text-gray-800 flex items-center gap-2 font-be-vietnam">
              <div className="w-2 h-2 bg-blue-500 rounded-full animate-pulse"></div>
              Date of Birth :
            </Label>
            <div className="relative group">
              <Input
                type="date"
                value={formData.dateOfBirth}
                onChange={(e) => handleInputChange("dateOfBirth", e.target.value)}
                className="h-14 bg-white/80 backdrop-blur-sm border-2 border-gray-200 rounded-xl text-gray-700 text-lg px-4 transition-all duration-300 focus:border-blue-400 focus:shadow-lg focus:shadow-blue-100 hover:border-blue-300 font-be-vietnam"
                required
              />
              <div className="absolute inset-0 rounded-xl bg-gradient-to-r from-blue-400/10 to-teal-400/10 opacity-0 group-hover:opacity-100 transition-opacity duration-300 pointer-events-none"></div>
            </div>
          </div>

          <div className="space-y-3 animate-slide-up-more-delayed">
            <Label className="text-xl font-semibold text-gray-800 flex items-center gap-2 font-be-vietnam">
              <div className="w-2 h-2 bg-green-500 rounded-full animate-pulse"></div>
              Phone Number :
            </Label>
            <div className="relative group">
              <Input
                type="tel"
                inputMode="numeric"
                pattern="[0-9]*"
                placeholder="phone number"
                value={formData.phoneNumber}
                onChange={(e) => handleInputChange("phoneNumber", e.target.value)}
                className="h-14 bg-white/80 backdrop-blur-sm border-2 border-gray-200 rounded-xl text-gray-700 placeholder:text-gray-500 text-lg px-4 transition-all duration-300 focus:border-green-400 focus:shadow-lg focus:shadow-green-100 hover:border-green-300 font-be-vietnam"
                required
              />
              <div className="absolute inset-0 rounded-xl bg-gradient-to-r from-green-400/10 to-teal-400/10 opacity-0 group-hover:opacity-100 transition-opacity duration-300 pointer-events-none"></div>
            </div>
          </div>
        </div>

        <div className="pt-8 flex justify-end animate-fade-in-final">
          <Button
            onClick={handleNext}
            disabled={isLoading}
            className="relative bg-gradient-to-r from-teal-500 to-teal-600 hover:from-teal-600 hover:to-teal-700 text-white font-semibold text-lg px-8 py-3 rounded-xl border-0 transition-all duration-300 transform hover:scale-105 hover:shadow-lg hover:shadow-teal-200 disabled:opacity-50 disabled:cursor-not-allowed disabled:transform-none group overflow-hidden font-be-vietnam"
          >
            {isLoading ? (
              <div className="flex items-center gap-2">
                <div className="w-5 h-5 border-2 border-white/30 border-t-white rounded-full animate-spin"></div>
                Processing...
              </div>
            ) : (
              <>
                <span className="relative z-10">Next</span>
                <div className="absolute inset-0 bg-gradient-to-r from-white/20 to-transparent opacity-0 group-hover:opacity-100 transition-opacity duration-300"></div>
              </>
            )}
          </Button>
        </div>
      </div>

      {/* Custom CSS for animations */}
      <style jsx>{`
        @keyframes float {
          0%, 100% { transform: translateY(0px); }
          50% { transform: translateY(-10px); }
        }
        
        @keyframes float-delayed {
          0%, 100% { transform: translateY(0px); }
          50% { transform: translateY(-15px); }
        }
        
        @keyframes pulse-slow {
          0%, 100% { opacity: 0.2; }
          50% { opacity: 0.4; }
        }
        
        @keyframes pulse-slower {
          0%, 100% { opacity: 0.15; }
          50% { opacity: 0.3; }
        }
        
        @keyframes heartbeat {
          0%, 100% { stroke-dasharray: 0, 2000; }
          50% { stroke-dasharray: 2000, 0; }
        }
        
        @keyframes heartbeat-icon {
          0%, 100% { transform: scale(1); }
          50% { transform: scale(1.1); }
        }
        
        @keyframes bounce-slow {
          0%, 100% { transform: translateY(0); }
          50% { transform: translateY(-5px); }
        }
        
        @keyframes spin-slow {
          from { transform: rotate(0deg); }
          to { transform: rotate(360deg); }
        }
        
        @keyframes fade-in {
          from { opacity: 0; transform: translateY(20px); }
          to { opacity: 1; transform: translateY(0); }
        }
        
        @keyframes fade-in-delayed {
          from { opacity: 0; transform: translateY(20px); }
          to { opacity: 1; transform: translateY(0); }
        }
        
        @keyframes slide-up {
          from { opacity: 0; transform: translateY(30px); }
          to { opacity: 1; transform: translateY(0); }
        }
        
        @keyframes slide-up-delayed {
          from { opacity: 0; transform: translateY(30px); }
          to { opacity: 1; transform: translateY(0); }
        }
        
        @keyframes slide-up-more-delayed {
          from { opacity: 0; transform: translateY(30px); }
          to { opacity: 1; transform: translateY(0); }
        }
        
        @keyframes fade-in-final {
          from { opacity: 0; transform: translateY(20px); }
          to { opacity: 1; transform: translateY(0); }
        }
        
        .animate-float {
          animation: float 3s ease-in-out infinite;
        }
        
        .animate-float-delayed {
          animation: float-delayed 4s ease-in-out infinite;
        }
        
        .animate-pulse-slow {
          animation: pulse-slow 3s ease-in-out infinite;
        }
        
        .animate-pulse-slower {
          animation: pulse-slower 4s ease-in-out infinite;
        }
        
        .animate-heartbeat {
          animation: heartbeat 4s ease-in-out infinite;
        }
        
        .animate-heartbeat-icon {
          animation: heartbeat-icon 1.5s ease-in-out infinite;
        }
        
        .animate-bounce-slow {
          animation: bounce-slow 2s ease-in-out infinite;
        }
        
        .animate-spin-slow {
          animation: spin-slow 20s linear infinite;
        }
        
        .animate-fade-in {
          animation: fade-in 0.8s ease-out;
        }
        
        .animate-fade-in-delayed {
          animation: fade-in-delayed 1s ease-out 0.2s both;
        }
        
        .animate-slide-up {
          animation: slide-up 0.6s ease-out 0.3s both;
        }
        
        .animate-slide-up-delayed {
          animation: slide-up-delayed 0.6s ease-out 0.5s both;
        }
        
        .animate-slide-up-more-delayed {
          animation: slide-up-more-delayed 0.6s ease-out 0.7s both;
        }
        
        .animate-fade-in-final {
          animation: fade-in-final 0.6s ease-out 0.9s both;
        }
      `}</style>
    </div>
  )
}
